import { Component } from '@angular/core';
import { CallerService } from '../services/caller.service';
import { SpinnerService } from '../services/spinner.service';
import { Subscription } from 'rxjs';

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {
  ContactList: any;
  noOfGridColumn = 2;
  subscription: Subscription[] = [];

  constructor(private callerService: CallerService,
    private spinnerService: SpinnerService) { }

  ionViewDidEnter() {
    this.spinnerService.present('Loading contacts...');
    this.subscription.push(this.callerService.getContacts().subscribe(data => {
      this.ContactList = data;
      this.ContactList = this.matrixify(this.ContactList);
      this.spinnerService.dismiss();
    }));
  }

  ionViewDidLeave() {
    this.subscription.forEach(element => {
      element.unsubscribe();
    });
  }

  callToNumber(phno: number) {
    this.callerService.callTo(phno.toString());
  }

  getImage(image: any) {
    if (image === undefined) {
      // tslint:disable-next-line: max-line-length
      return 'data:image/png;base64,';
    }
    return image.stringValue;
  }

  matrixify(ContactList: any): any {
    let index = 0;
    const finalList = [];
    while (index < ContactList.length) {
      const rowList = [];
      const pos = index;
      for (let i = pos; i < pos + this.noOfGridColumn; i++) {
        if (ContactList[i] != null) {
          rowList.push(ContactList[i]);
          index++;
        } else {
          break;
        }
      }
      finalList.push(rowList);
    }
    return finalList;
  }

}
